import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_desktop.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_desktop.png'));

    // Set viewport to a mobile size to make the mobile menu visible
    await page.setViewportSize({ width: 375, height: 667 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_view.png'));

    // Find and click the mobile menu trigger ("All" button)
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // Wait for the mobile menu overlay to appear
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_open.png'));

    // Click on a category link within the mobile menu, e.g., "Electronics"
    const electronicsLink = page.locator('.mobile-menu a:text("Electronics")').first();
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsLink.click();

    // The script simulates a loading state, wait for it to disappear
    await page.locator('.loading-overlay').waitFor({ state: 'hidden', timeout: 5000 });

    // Verify navigation by checking for the category heading
    const categoryHeading = page.locator('h2:has-text("Electronics")');
    await categoryHeading.waitFor({ state: 'visible', timeout: 5000 });
    const headingText = await categoryHeading.innerText();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_electronics_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_electronics_page.png'));

    // Re-open the menu to test closing it
    await menuTrigger.click();
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });

    // Find and click the close button within the mobile menu
    const closeButton = page.locator('.mobile-menu button.close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Verify the menu is closed by waiting for the overlay to be hidden
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_menu_closed.png'));

    return {
      success: true,
      action: "Successfully tested mobile menu opening, navigation, and closing.",
      extractedData: {
        categoryPageHeading: headingText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
